import React, { Component } from 'react';

export default class AddBook extends Component {
    constructor(props) {
        super(props);

        this.state = {

        title: '',
        author: '',
        year_of_pub: 0,
        isbn: '',
        copies: 0
        }
    }

    render() {
        return (
            <div>
                <p>This is the Add Book component!</p>
            </div>
        )
    }
}
